import React, { useEffect } from "react";
import axios from "axios";

const Projects = props => {
  useEffect(() => {
    axios.get("http://localhost:5000");
  }, []);
  return <h1 style={{ marginTop: "180px" }}>List of Projects</h1>;
};

export default Projects;
